import Col from 'react-bootstrap/Col';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image';
import Row from 'react-bootstrap/Row';
import Card from 'react-bootstrap/Card';

const characters = [
  {name: 'Calamardo', image:'https://th.bing.com/th/id/OIP.IXJKy_PHCB643c7qI8A4QgHaG3?pid=ImgDet&rs=1', state:true},
  {name: 'Da Vinci', state:true},
  {name: 'Dr. Simi', state:true},
  {name: 'Mulán', state:true},
  {name: 'Mamá Coco', state:true},
  {name: 'Dr. Simi', state:true},
  {name: 'Mulán', state:true},
  {name: 'Mamá Coco', state:true},
]

function Character() {
  return (
    characters.map((character => 
    <Container style={{margin:'0px'}}>
        <Card style={{float:"left",  width:'100px', height:'20', margin:'20px', padding:'20px', backgroundColor:'#DAF7A6', alignItems:'center', textAlign:'center'}}>
     <Card.Img variant="top" width='100px' height='100px' src={character.image} />
      <Card.Body>
        <Card.Title>{character.name}</Card.Title><br/>
        </Card.Body>
        </Card>
    </Container>
    ))
  );
}

export default Character;
